    false,nt"url": null,nt"notes": "This annual report is on a two year study,
    started in 1998, to evaluate the daily and seasonal habitat use to determine the
    location of the hibemaculum of the Wyoming Toad, Bufo hemiophrys baxteri, with the
    use of radio telemetry, as a part of a Master's project for the University of Wyoming.
     This study took place at Mortenson Lake National Wildlife Refuge, Wyoming.  Nine
    toads were implanted with radio transmitters, and were tracked over a period of
    approximately two months (1 August 1998 through 1 October 1998).   This summary
    discusses the objectives, methods, results from 1998, observations, recommendations,
    and proposed research for the 1999 field season.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
